(1, 'Yg2APBDjcmaN5CKVyZ9qL8hE4OS0FQIG', 'MSGH000001', '2', NULL, 'Introduction to Computing', 'unit', '1st', '2020/2021', '&lt;div&gt;&lt;!--block--&gt;This agreement is made this day &lt;strong&gt;11th July, 2021, &lt;/strong&gt;Between &lt;strong&gt;WILLIAM ADJEI ABANKWA &lt;/strong&gt;of House No. BT 128, Sekyere Begoro in the Fanteakwa North District in the Eastern Region of the Republic of Ghana (Hereinafter called the Lessors); &lt;strong&gt;MR. DANIEL KENNETH BANSAH, MR. PETER KERSI AND MR. WILLIAM KWAO ANSAH &lt;/strong&gt;(Hereinafter called the Lessee).&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;That no member of my family has the right of ownership of the said farm land again after the total payment have been made.&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;That in consideration, of Sixty Thousand Ghana Cedis (GHS60,000.00) as part payment for the total amount of One Hundred and Twenty Thousand Ghana Cedis Only (GHS120,000.00) has been made for the farmland.&lt;/div&gt;', '2021-08-09', '2021-08-09', 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL', '2021-08-09 06:20:54', '2021-08-09 06:20:54', '1'),
(2, 'QSmGlUMeCy1ujpcihozqH2avLI8An59J', 'MSGH000001', '2', '1', 'Introduction', 'lesson', '1st', '2020/2021', '&lt;div&gt;&lt;!--block--&gt;This agreement is made this day &lt;strong&gt;11th July, 2021, &lt;/strong&gt;Between &lt;strong&gt;WILLIAM ADJEI ABANKWA &lt;/strong&gt;of House No. BT 128, Sekyere Begoro in the Fanteakwa North District in the Eastern Region of the Republic of Ghana (Hereinafter called the Lessors); &lt;strong&gt;MR. DANIEL KENNETH BANSAH, MR. PETER KERSI AND MR. WILLIAM KWAO ANSAH &lt;/strong&gt;(Hereinafter called the Lessee).&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;That no member of my family has the right of ownership of the said farm land again after the total payment have been made.&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;That in consideration, of Sixty Thousand Ghana Cedis (GHS60,000.00) as part payment for the total amount of One Hundred and Twenty Thousand Ghana Cedis Only (GHS120,000.00) has been made for the farmland.&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;&lt;strong&gt;SIGNED / MARKED &lt;/strong&gt;and delivered by the said&nbsp;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;&lt;strong&gt;MR. WILLIAM ADJEI ABANKWA &lt;/strong&gt;after the&nbsp;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;contents have been read and explained to them in ………………………………….&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;Akan Language where they seemed to understand &lt;strong&gt;Lessors&lt;/strong&gt;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;before signing their signature / mark&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;thumbprint hereto in the presence of: -&lt;/div&gt;', '2021-08-09', '2021-08-11', 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL', '2021-08-09 06:28:04', '2021-08-09 06:28:04', '1'),
(3, '64Vv8f0K3sYWyOCrMZbSgPd57iXzqcNp', 'MSGH000001', '2', NULL, 'Word Processing Applications', 'unit', '1st', '2020/2021', '&lt;div&gt;&lt;!--block--&gt;&lt;em&gt;Word processing is a phrase used to describe the process of using a software program to create, edit or format and also print out a text document.&lt;/em&gt;&lt;/div&gt;', '2021-08-14', '2021-08-28', 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL', '2021-08-14 16:32:56', '2021-08-14 19:35:23', '1'),
(4, '0xAy3wWPOKVCDfS741UgTHz5a2IhiuYM', 'MSGH000001', '2', '3', 'Introduction', 'lesson', '1st', '2020/2021', '&lt;div&gt;&lt;!--block--&gt;&lt;em&gt;Word processing is a phrase used to describe the process of using a software program to create, edit or format and also print out a text document.&lt;/em&gt;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;In order to edit text on the computer you need a software program called &lt;strong&gt;a word processor &lt;/strong&gt;that will make the work simple. With this in mind, &lt;strong&gt;a word processor &lt;/strong&gt;&lt;em&gt;is a software program used to create and edit text on the computer.&nbsp;&lt;/em&gt;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;Word Processors takes advantage of a graphical user interface providing some form of &lt;em&gt;What-You-See-Is-What-You-Get &lt;/em&gt;&lt;strong&gt;(WYSIWYG)&lt;/strong&gt; editing.&nbsp;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;&lt;strong&gt;WYSIWYG &lt;/strong&gt;is an acronym for &lt;strong&gt;What-You-See-Is-What-You-Get.&lt;/strong&gt;&lt;em&gt;It implies a user interface that allows the user to view something very similar to the end result while the document is in its soft copy state.&lt;/em&gt;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;The reason why one will choose a word processor as compared to the traditional typewriter is that:&lt;/div&gt;&lt;ol&gt;&lt;li&gt;&lt;!--block--&gt;Word processors makes the work very neat&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;It enables you to make corrections where necessary. Example: the Spell Checker, Grammar Checker.&nbsp;&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;It enhances the appearance of the work. This is because you have the opportunity to add colors, shapes and more styles to your work.&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;One can input data from a database and use it to create a mail message.&lt;/li&gt;&lt;/ol&gt;&lt;div&gt;&lt;!--block--&gt;There are countless reasons why one will prefer using a computer software program to edit his text document. However, just a few have been list above.&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;&lt;strong&gt;Example of word processors:&lt;/strong&gt;&lt;/div&gt;&lt;ol&gt;&lt;li&gt;&lt;!--block--&gt;Microsoft Office Word&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;Open Office&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;WordPad&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;Notepad&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;Libre Office&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;WordPerfect&lt;/li&gt;&lt;/ol&gt;&lt;div&gt;&lt;!--block--&gt;Among the list of examples listed above, Microsoft Office Word is the most used today. It comes with various versions like MS Office 2003, MS Office 2007, MS Office 2010 and MS Office 2015. Microsoft Word is a word processor developed by Microsoft Inc. It was first released in 1983.&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;It is an important word processing program that allows you to create and enhance a wide range of documents quickly and easily. In Microsoft Word you can type and edit text, copy and paste text from one location to another, format texts and paragraphs, insert graphs, tables and images to enhance your documents.&lt;/div&gt;', '2021-08-14', '2021-08-17', 'q2kodPX9QzrSjbTGNOsyW4n175ip0uCh', '2021-08-14 19:36:03', '2021-08-14 19:36:03', '1'),
(5, 'OI5Q0TFKAzMrbYljSyehZuJfBvVGdksE', 'MSGH000001', '2', '3', 'Features of MS Office Word', 'lesson', '1st', '2020/2021', '&lt;ol&gt;&lt;li&gt;&lt;!--block--&gt;&lt;strong&gt;Toolbar: &lt;/strong&gt;&lt;em&gt;A toolbar is a row, column or group of onscreen icons which helps a user to perform specific tasks.&lt;/em&gt; The toolbar is filled with buttons and other tools. Each button represents a command which correspond to a menu command.&lt;/li&gt;&lt;/ol&gt;&lt;div&gt;&lt;!--block--&gt;There are two toolbars used in Word Processing they are:&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;i&lt;strong&gt;. Standard Toolbar&lt;/strong&gt; – it contains various commands that help edit the word document. It contains tools like: New, Open, Save, Save As, Print, Print Preview, Close etc.&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;ii. &lt;strong&gt;Formatting Toolbar –&lt;/strong&gt; It contains tools like Bold, Italics, Underline, Font Color, Font Size, Font Style, Text Alignments (left, right, center, justify), Line Spacing, Bullets and Numbering.&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;&lt;br&gt;&lt;/div&gt;&lt;ol&gt;&lt;li&gt;&lt;!--block--&gt;&lt;strong&gt;Title bar: &lt;/strong&gt;The title bar is located at the top of the MS Word window. It contains the &lt;strong&gt;&lt;em&gt;name of the file&lt;/em&gt;&lt;/strong&gt; you are working with, the &lt;strong&gt;&lt;em&gt;name of the application, &lt;/em&gt;&lt;/strong&gt;the &lt;strong&gt;&lt;em&gt;image or logo of the application, &lt;/em&gt;&lt;/strong&gt;and the &lt;strong&gt;&lt;em&gt;control box.&lt;/em&gt;&lt;/strong&gt; The &lt;em&gt;control box &lt;/em&gt;also has three features: &lt;em&gt;minimize button, maximize button &lt;/em&gt;and &lt;em&gt;close button.&lt;/em&gt;&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;&lt;strong&gt;The Menu Bar: &lt;/strong&gt;The menu bar is located beneath the title bar. It contains commands that will enable you to fully edit your document. Some items on the menu bar can be: &lt;em&gt;Home, Insert, Page Layout, Format, View &lt;/em&gt;and the like.&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;&lt;strong&gt;Horizontal &amp; Vertical Scroll Bar:&lt;/strong&gt; The scroll bars enables you to view other pages that are visible in the current display view. For example: if you have 5 pages in your text document, obviously, you cannot view all pages at the same time. Hence with the help of the scroll bars you can view all other pages.&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;&lt;strong&gt;Insertion Point:&lt;/strong&gt; The insertion point looks like an I Beam. It tells you where the text will appear if you type.&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;&lt;strong&gt;Status Bar: &lt;/strong&gt;The status bar is located at the bottom of the window. It displays the &lt;em&gt;total number of pages, total number of words (with spaces &amp; without spaces) and also displays the current action that is being undertaken by the user. &lt;/em&gt;It also contains the &lt;em&gt;zoom options.&lt;/em&gt;&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;&lt;strong&gt;Ruler: &lt;/strong&gt;The ruler is used to set dimensions. One can use it to manage the margins as well.&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;&lt;strong&gt;Formatting Toolbar:&lt;/strong&gt; The formatting toolbar is used to format the text. By changing the font style, size, color and shape. It helps to add more features to your work. For example: &lt;em&gt;changing line spacing, using the numbering and bulleting.&lt;/em&gt;&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;&lt;strong&gt;Working Area:&lt;/strong&gt; The working area is the white plain area where the real typing takes place.&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;&lt;strong&gt;Quick Access Area:&lt;/strong&gt; The quick access area is located at the left side of the title bar; just beside the application logo. It helps you quickly perform a task. By default it contains the &lt;em&gt;Save, Undo &lt;/em&gt;and&lt;em&gt; Redo buttons.&lt;/em&gt;&lt;/li&gt;&lt;/ol&gt;&lt;div&gt;&lt;!--block--&gt;&lt;strong&gt;NOTE: &lt;/strong&gt;Please go to the&lt;strong&gt; HOW TO &lt;/strong&gt;sectionof this document to find the following:&lt;/div&gt;&lt;ol&gt;&lt;li&gt;&lt;!--block--&gt;How to Create or Open MS Word from the Desktop.&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;How to Create or Open MS Word from the Start Menu.&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;How to Insert Pictures in MS Word&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;How to Print Out an MS Word document&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;How to &lt;strong&gt;Save&lt;/strong&gt; a Text / MS Word document using the &lt;strong&gt;SaveAs&lt;/strong&gt; command&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;How to &lt;strong&gt;Save&lt;/strong&gt; a Text / MS Word document using the &lt;strong&gt;Save&lt;/strong&gt; command.&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;How to Copy and Paste text in a Text / MS Word document&lt;/li&gt;&lt;/ol&gt;', '2021-08-17', '2021-08-18', 'q2kodPX9QzrSjbTGNOsyW4n175ip0uCh', '2021-08-14 19:38:06', '2021-08-14 19:38:06', '1'),
(6, 'PhJtymi702EOVcQu49eKzvgCXwlGRnTr', 'MSGH000001', '2', '3', 'Printing', 'lesson', '1st', '2020/2021', '&lt;div&gt;&lt;!--block--&gt;A document displayed on the computer screen is known as soft copy. Thus, you can only view it on the computer. To put what you see non the computer screen on a piece of paper is what is referred to as &lt;strong&gt;printing. &lt;/strong&gt;&lt;em&gt;Printing is the process of transferring the text you have typed and images inserted into a document unto a piece of paper.&lt;/em&gt; Before one can perform printing you need a hardware device called a printer.&nbsp;&lt;br&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;Also, the user needs to go through the work that he or she has typed properly before printing it out; this is what is referred to as &lt;strong&gt;print previews.&lt;/strong&gt;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;&lt;strong&gt;Print Preview &lt;/strong&gt;&lt;em&gt;helps the user to have a feel of what the document will look like when printed out on the piece of paper&lt;/em&gt;. It is of much importance in the sense that,&lt;/div&gt;&lt;ol&gt;&lt;li&gt;&lt;!--block--&gt;It helps the user to correct every mistake that might have been done when preparing the work.&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;Set the appropriate margins and paper sizes before the actual printing is done.&lt;/li&gt;&lt;/ol&gt;&lt;div&gt;&lt;!--block--&gt;There are basically two types of printers. They are:&lt;/div&gt;&lt;ol&gt;&lt;li&gt;&lt;!--block--&gt;Impact printers&nbsp;&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;Non-impact printers&lt;/li&gt;&lt;/ol&gt;&lt;div&gt;&lt;!--block--&gt;&lt;strong&gt;Impact printers&lt;/strong&gt; form characters on a piece of paper by striking an ink ribbon on it. Examples are &lt;em&gt;dot matrix printers&lt;/em&gt;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;However, a &lt;strong&gt;non-impact printer&lt;/strong&gt; prints on a piece of paper without striking it.&nbsp;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;Usually, impact printers makes a lot of noise whiles printing and also has a poor print out quality. This is not so with non-impact printers.&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;There are various means to print out a document. Two methods have discussed below&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;!--block--&gt;&lt;strong&gt;Method 1 – (printing from the standard toolbar)&lt;/strong&gt;&lt;/div&gt;&lt;ol&gt;&lt;li&gt;&lt;!--block--&gt;Click on the Print icon on the standard toolbar to display the print dialog window&nbsp;&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;Select your desired options (the number of copies, the print range, the printer you want to use, the paper sizes, the page orientation)&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;Click on the Print button&lt;/li&gt;&lt;/ol&gt;&lt;div&gt;&lt;!--block--&gt;&lt;strong&gt;Method 2 – (printing from the file menu)&lt;/strong&gt;&lt;/div&gt;&lt;ol&gt;&lt;li&gt;&lt;!--block--&gt;Click on File on the menu bar to drop down a menu&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;Click on the Print button to display the print dialog window&nbsp;&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;Select your desired options (the number of copies, the print range, the printer you want to use, the paper sizes, the page orientation)&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;Click on the Print button&lt;/li&gt;&lt;/ol&gt;&lt;div&gt;&lt;!--block--&gt;&lt;strong&gt;Method 3 – (printing using the shortcut key)&lt;/strong&gt;&lt;/div&gt;&lt;ol&gt;&lt;li&gt;&lt;!--block--&gt;Press the keys Ctrl + P on the keyboard to display the print dialog window&nbsp;&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;Select your desired options (the number of copies, the print range, the printer you want to use, the paper sizes, the page orientation)&lt;/li&gt;&lt;li&gt;&lt;!--block--&gt;Click on the Print button&lt;/li&gt;&lt;/ol&gt;', '2021-08-19', '2021-08-23', 'q2kodPX9QzrSjbTGNOsyW4n175ip0uCh', '2021-08-14 19:40:22', '2021-08-14 19:40:22', '1'),
