(3, 'MSGH000001', '1XBA76E4qILPMCrQ', 'CjoA1cOelmsuV869', 'QnzoG0w7Cj98NTHeulchx4BLR5psiJOY', NULL, NULL, 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL', NULL, 'followup', NULL, 'You have received the Tithe receipt books. This is arranged in order of Class Leaders. We are aware that new Class Leaders are being prepared to help with the class arrangement.', NULL, NULL, '2021-08-25 23:24:00', '2021-08-25 23:24:00', '0', 'Pending'),
(4, 'MSGH000001', 'SC36aEHDQkxLY2um', 'CjoA1cOelmsuV869', 'QnzoG0w7Cj98NTHeulchx4BLR5psiJOY', NULL, NULL, 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL', NULL, 'followup', NULL, 'It is my recommendation that you start with fresh/new receipt books for the various class leaders once the exercise has been concluded. Please endeavor to issue receipts for all tithe payments on the day of receipt and return the tithe cards to the individuals before close of Church service.', NULL, NULL, '2021-08-25 23:24:13', '2021-08-25 23:24:13', '0', 'Pending'),
(5, 'MSGH000001', 'TlmBXkYtKd5MjcI8', 'CjoA1cOelmsuV869', 'QnzoG0w7Cj98NTHeulchx4BLR5psiJOY', NULL, NULL, 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL', NULL, 'followup', NULL, 'After issuing the receipts all payments are to be recorded in the register which has been handed to you.', NULL, NULL, '2021-08-25 23:24:56', '2021-08-25 23:24:56', '0', 'Pending'),
(6, 'MSGH000001', 'UQr0Gmqxs8NIplHK', NULL, 'S8OZg2IMwbAJfBsc', 'student', 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL', 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL', 'varrrick adu', 'incident', 'bullying', '&lt;div&gt;&lt;!--block--&gt;he bullied a student.&lt;/div&gt;', '2021-08-24', 'school premises', '2021-08-26 16:29:53', '2021-08-26 16:31:38', '0', 'Solved'),
