(1, 'MSGH000001', 'GDcyR675vENizZI', 'sms', 'Test Campaign', NULL, 'Hello Parent, This is to remind you of the coming Parent Teachers Meeting scheduled for Friday 25th August 2021 at the Conference Hall. Time is 11:00AM.', 'class', '[{\"name\":\"Emmanuella Darko Sarfowaa\",\"user_type\":\"student\",\"unique_id\":\"ST000032021\",\"item_id\":\"1526BaoMyt8Inh3c0zugePkbKfsGHNmX\",\"phone_number\":\"0247685521\"}]', '[\"1526BaoMyt8Inh3c0zugePkbKfsGHNmX\"]', '0', '1', '2021-08-12 16:10:15', 'Pending', NULL, 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL', '2021-08-12 16:08:15'),
(2, 'MSGH000001', 'VEC3nM5xlP9LtuH', 'sms', 'Final Test to Group', NULL, 'This is to remind all that we are on strike and we will resume next week monday. All should ensure that this directive is adhered to strictly. Thank you.', 'group', '[{\"name\":\"Emmanuel Obeng Hyde\",\"user_type\":\"admin\",\"unique_id\":\"MSISU000001\",\"item_id\":\"HjwXoJQNresMBFznDW7qAGaTCOY0c6kL\",\"phone_number\":\"233550107770\"}]', '[\"HjwXoJQNresMBFznDW7qAGaTCOY0c6kL\"]', '0', '1', '2021-08-12 16:17:50', 'Pending', NULL, 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL', '2021-08-12 16:15:50'),
(3, 'MSGH000001', 'WtDBxpNgk2HyAMX', 'email', 'Test Email', NULL, '&lt;div&gt;&lt;!--block--&gt;Send&nbsp; a test email message to the list&lt;/div&gt;', 'class', '[{\"name\":\"Sani Abdul Jabal \",\"user_type\":\"student\",\"unique_id\":\"ST000012021\",\"item_id\":\"KDtbYhedUAgTC8sG1caxV6LfEklMjvFn\",\"email\":\"sanijabal@gmail.com\"},{\"name\":\"Fredrick Asamoah \",\"user_type\":\"student\",\"unique_id\":\"ST000022021\",\"item_id\":\"aaabYhedUAgTC8sG1caxV6LfEklMjvFn\",\"email\":\"fredrickasamoah@gmail.com\"}]', '[\"KDtbYhedUAgTC8sG1caxV6LfEklMjvFn\",\"aaabYhedUAgTC8sG1caxV6LfEklMjvFn\"]', '0', '0', '2021-08-12 16:47:52', 'Pending', NULL, 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL', '2021-08-12 16:45:52');
