INSERT INTO `support_tickets` (`id`, `client_id`, `parent_id`, `subject`, `section`, `department`, `content`, `user_type`, `rating`, `date_created`, `date_updated`, `status`, `user_id`) VALUES
(1, 'MSGH000001', 0, 'Paid for SMS', 'Payments', 'Sales_Billing', 'Hello, Please i have made payment for an sms but it has not yet reflected on my account. Please help me out with this. Thank you.', 'user', 0, '2021-08-07 12:59:56', '2021-08-07 14:53:46', 'Closed', 'aB7iLyOZnzVRHF1X6UmWdtxkD8gpNTbM'),
(2, 'MSGH000001', 0, 'Problem on Page', 'Courses_Lesson_Planner', 'Usage_Problem', 'Hello, Please i am finding challenges with some of the use case most especially on the Students Fees Payment page. Please what steps can i follow to reverse a fees payment made on the system. This is very urgent. Help me out please.', 'user', 0, '2021-08-07 13:03:58', '2021-08-07 15:04:23', 'Closed', 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL'),
(6, 'MSGH000001', 2, NULL, NULL, NULL, 'Please i have waited and waited and waited but no reponse. Please help me with this. Thank you.', 'user', 0, '2021-08-07 14:13:36', NULL, 'Pending', 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL'),
(7, 'MSGH000001', 2, NULL, NULL, NULL, 'Oh please why are you delaying replying me on this issue... The message was sent about 20 minutes ago but no reply as at now.', 'user', 0, '2021-08-07 14:19:01', NULL, 'Pending', 'aaabYhedUAgTC8sG1caxV6LfEklMjvFn'),
(8, 'MSGH000001', 1, NULL, NULL, NULL, 'Whats the situation on this one too?', 'user', 0, '2021-08-07 14:19:17', NULL, 'Pending', 'aaabYhedUAgTC8sG1caxV6LfEklMjvFn'),
(9, 'MSGH000001', 1, NULL, NULL, NULL, 'What sought of Customer service are you running at your end?', 'user', 0, '2021-08-07 14:27:08', NULL, 'Pending', 'aB7iLyOZnzVRHF1X6UmWdtxkD8gpNTbM'),
(10, 'MSGH000001', 1, NULL, NULL, NULL, 'Thanks for reaching out to us. Please kindly note that your account has been credited with the amount. Thank you.', 'support', 0, '2021-08-07 14:48:35', NULL, 'Pending', 'aaabYhedUAgTC8sG1caxV6LfEklMjvFn'),
(11, 'MSGH000001', 1, NULL, NULL, NULL, 'Alright Thanks for the reply. I really do appreaciate it.', 'user', 0, '2021-08-07 14:53:46', NULL, 'Pending', 'aaabYhedUAgTC8sG1caxV6LfEklMjvFn'),
(12, 'MSGH000001', 2, NULL, NULL, NULL, 'Kindly send us the Receipt ID of the payment to reverse. Thank you.', 'support', 0, '2021-08-07 15:03:01', NULL, 'Pending', 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL'),
(13, 'MSGH000001', 2, NULL, NULL, NULL, 'It is RE190293 Thanks for the support.', 'user', 0, '2021-08-07 15:03:39', NULL, 'Pending', 'aaabYhedUAgTC8sG1caxV6LfEklMjvFn'),
(14, 'MSGH000001', 2, NULL, NULL, NULL, 'We have successfully reversed the payment. Please for contacting support.', 'support', 0, '2021-08-07 15:04:23', NULL, 'Pending', 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL'),
(15, 'MSGH000001', 0, 'Unable to Generate', 'Timetable_Generation', 'Support', 'I am having challenges generating the timetable. Please help me out.', 'user', 0, '2021-08-14 22:31:38', '2021-08-21 11:35:50', 'Closed', 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL'),
(16, 'MSGH000001', 0, 'Account Suspended', 'Account_Suspension', 'Support', 'Please i am given the notification that my account has been suspended. Please what is the cause of it and how may i rectify this issue?', 'user', 0, '2021-08-21 11:06:33', '2021-08-21 11:32:47', 'Closed', 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL'),
(17, 'MSGH000001', 16, NULL, NULL, NULL, 'Thanks for contacting Support. Please note that your account has violated our terms of use of the platform. We have on several occassions detected anomalies with respect to trying to exceed the quota alloted you with regards to the number of students, staff and fees payment using our external payment integration. This is strictly against our rules and that has led to the suspension of your account. Thank you.', 'support', 0, '2021-08-21 11:13:34', NULL, 'Closed', 'MSGH0001'),
(18, 'MSGH000001', 16, NULL, NULL, NULL, 'Alright, thanks for the response. But please what can we do to regain the account back?', 'user', 0, '2021-08-21 11:30:14', NULL, 'Closed', 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL'),
(19, 'MSGH000001', 15, NULL, NULL, NULL, 'Alright. We will look into it and revert with the steps on how to perform this action.', 'support', 0, '2021-08-21 11:30:52', NULL, 'Closed', 'MSGH0001'),
(20, 'MSGH000001', 15, NULL, NULL, NULL, 'Thanks for the response. Well appreciated.', 'user', 0, '2021-08-21 11:31:12', NULL, 'Closed', 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL'),
(21, 'MSGH000001', 16, NULL, NULL, NULL, 'We will reactivate the account for you. But ensure you adhere to our laid down policies. Thanks for contacting support.', 'support', 0, '2021-08-21 11:31:58', NULL, 'Closed', 'MSGH0001'),
(22, 'MSGH000001', 16, NULL, NULL, NULL, 'Thanks. Well appreciated.', 'user', 0, '2021-08-21 11:32:47', NULL, 'Closed', 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL'),
(23, 'MSGH000001', 15, NULL, NULL, NULL, 'Problem has been fixed. Please you can proceed to create the timetable. Thanks for your patience.', 'user', 0, '2021-08-21 11:35:50', NULL, 'Closed', 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL'),
(24, 'MSGH000001', 0, 'Reactivate Account', 'Account', 'Sales_Billing', 'Hello, Please i will like to reactivate our account for one additional year. How should i make payment?', 'user', 0, '2021-08-21 11:45:54', '2021-08-21 11:51:57', 'Answered', 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL'),
(25, 'MSGH000001', 24, NULL, NULL, NULL, 'I will need you to respond to this message as soon as possible. We want to decide on this at our next meeting which comes off in the next 1 hour. Thank you.', 'user', 0, '2021-08-21 11:46:57', NULL, 'Pending', 'HjwXoJQNresMBFznDW7qAGaTCOY0c6kL'),
(26, 'MSGH000001', 24, NULL, NULL, NULL, 'Well noted.&lt;br&gt;Kindly check your email for an invoice to this effect.&lt;br&gt;Thank you.', 'support', 0, '2021-08-21 11:51:57', NULL, 'Pending', 'MSGH0001');
